import React, { useEffect, useState } from "react";
import Cookies from "js-cookie";
import axios from "axios";
import "./_doctor-settiming.css";

const Doc_setting: React.FC = () => {
  const t9 = '9:00:00';
  const usr = Cookies.get("docname");
  const [s9, setS9] = useState<boolean>(true);

  useEffect(() => {
    if (usr === "err") {
      window.location.href = '/doctor_login';
    }
  }, [usr]);

  const LogOut = () => {
    Cookies.set("docname", "err");
    window.location.href = '/doctor_login';
  };

  const fetchTiming = async (y: string) => {
    try {
      const detail = {
        "usr": usr,
        "time": y,
      };
      const response = await axios.post('/fetchtiming', detail);

      if (response.data.message === '1') {
        return true;
      } else {
        return false;
      }
    } catch (error) {
      console.error('Error sending data to Flask akshay:', error);
      return false;
    }
  };

  const updateTiming = async () => {
    const newS9 = await fetchTiming(t9);
    setS9(newS9);
  };

  const handleClick = (x: boolean, y: string) => {
    const detail = {
      "usr": usr,
      "time": y,
    };

    axios.post('/settiming', detail)
      .then((response) => {
        // Handle the response if needed
      })
      .catch((error) => {
        console.error('Error sending data to Flask akshay:', error);
      });

    return !x;
  };

  return (
    <div>
    vjnsjk njkvfnjk fn
    Set timing page for {usr}
    You are a doctor pola
    <div>
        <button className="LogoutButton" onClick={LogOut}>
                Log Out
        </button>
    </div>
    <div>
    <body>
<h2>Set Your Availability</h2>
<table>
<thead>
    <tr>
        <th>Time Slot</th>
        <th>Availability</th>
    </tr>
</thead>
<tbody>
    <tr>
        <td>9:00 AM - 9:30 AM</td>
        <td>
            <button className={s9?"available":"not-available"} onClick={() => setS9(handleClick(s9, t9))}>
            {s9?"Available":"Not-available"}
            </button>
        </td>
    </tr>
    <tr>
        <td>9:30 AM - 10:00 AM</td>
        <td><button className="set-availability unset">Not Available</button></td>
    </tr>
    <tr>
        <td>11:00 AM - 12:00 PM</td>
        <td><button className="set-availability unset">Not Available</button></td>
    </tr>

</tbody>
</table>

</body>
    </div>
</div>
  );
};

export default Doc_setting;
